import React from "react";
import vishal from "./imges/vishal.png"
import WavingHandIcon from '@mui/icons-material/WavingHand';
import Badge from 'react-bootstrap/Badge'; 
import { Col, Container, Row } from "react-bootstrap";
function GridBox(){
    return(
   <Container>
    <Row className="align-items-center">
<Col>
<img src={vishal} style={{width:"300px",height:"16em"}} alt=""/>
</Col>
<Col className="messages mb-3 text-center">

 <Badge bg="dark" className="p-4 rounded-5 fs-5"> 
 <WavingHandIcon className="me-2"/>
 Visitors I m Vishal
 </Badge>
<br/> 
      <Badge bg="warning" className="rounded-5 mt-3 p-4 fs-5">
        Vishnuj756@gmail.com
      </Badge>
</Col>
    </Row>
    </Container> 
    )
    
}
export default GridBox;
